import { useContext, useEffect, useState } from "react";
import { useNavigate, useParams } from "react-router-dom";
import { CommunityStateContext } from "../App";
import { ChallengeStateContext } from "../App";
import ChallengeEditor from "../components/CommunityEditor";

const Challenge_Edit = () => {
  const navigate = useNavigate;
  const { challengeNumber } = useParams();
  const [originData2, setOriginData2] = useState();

  const communityList = useContext(CommunityStateContext);

  useEffect(() => {
    if (communityList.length >= 1) {
      const targetChallenge = communityList.find(
        (it) => parseInt(it.id2) === parseInt(challengeNumber)
      );

      if (targetChallenge) {
        setOriginData2(targetChallenge);
      } else {
        navigate("/", { replace: true });
      }
      console.log(targetChallenge);
    }
  }, [communityList, challengeNumber]);

  return (
    <div>
      {originData2 && (
        <ChallengeEditor isEdit={true} originDat2={originData2} />
      )}
    </div>
  );
};

export default Challenge_Edit;
